import { PokeItemProps } from "../types/types";

const PokeItem: React.FC<PokeItemProps> = ({
    pokemon
}) => {
    //destructure
    const {image, name, types, abilities, user: useremail} = pokemon;
    return( 
    <div className="poke-card">
        <div className="poke-data">
            <img src={image} alt={name} className="poke-image" />
            <h3>Pokemon Name: {name}</h3>
            <p>
                <span>
                    Type: 
                </span> {types.join(", ")}
            </p>
            <p>
                <span>Ability: {abilities.join(", ")}</span>
            </p>
        </div>
    </div>)
    
}

export default PokeItem;
